!function(t){"use strict";t("body").on("click",'.zipli-login-form-ajax button[type="submit"]',e=>{var r=t(e.currentTarget).closest("form");return t.ajax({type:"POST",url:zipliAjax.ajaxurl,data:r.serialize(),beforeSend:()=>{r.addClass("loading"),r.find("input,button").prop("disabled",!0)},success:e=>{e.status?(r.find(".result-error").remove(),location.reload()):r.find(".result-error").length<=0&&r.prepend(`<div class="result-error">${e.msg}</div>`)},complete:function(){r.find("input,button").prop("disabled",!1),r.removeClass("loading")}}),!1})}(jQuery);